# Function to predict bets using the neural network
def predict_bets_nn(win_probs, bets):
    # Reshape the input array
    win_probs = np.array(win_probs).reshape(-1, 1)
    bets = np.array(bets).reshape(-1, 1)

    # Split the data into training and testing sets
    X_train, X_test, y_train, y_test = train_test_split(win_probs, bets, test_size=0.2, random_state=42)

    # Build the model
    model = Sequential([
        Dense(16, input_dim=win_probs.size, activation='relu'),
        Dense(8, activation='relu'),
        Dense(1, activation='linear')
    ])

    model.compile(optimizer='adam', loss='mean_squared_error')

    # Training the model
    model.fit(X_train, y_train, epochs=1000, verbose=0)

    # Evaluate the model on the test set
    loss = model.evaluate(X_test, y_test)
    print(f"Test Loss: {loss}")

    # Get the predicted bets
    predicted_bets_scaled = np.round(model.predict(X_test))

    return predicted_bets_scaled.astype(int)

